import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Importa BrowserRouter y Route

import Navbar from './components/Navbar';
import Home from './pages/Home';
import AddProducto from './productos/AddProducto';
import EditProducto from './productos/EditProducto';
import ViewProducto from './productos/ViewProducto';
import SobreNosotros from './pages/SobreNosotros';

const App = () => {
    return (
        <Router>
            <Navbar />
            <Route exact path="/" component={Home} />
            <Route exact path="/addproducto" component={AddProducto} />
            <Route exact path="/editproducto/:id" component={EditProducto} />
            <Route exact path="/viewproducto/:id" component={ViewProducto} />
            <Route exact path="/sobre" component={SobreNosotros} />
        </Router>
    );
};

export default App;
